export declare const MarkdownStr_a = "\u6839\u636E\u300A\u5EFA\u8BBE\u9879\u76EE\u5B89\u5168\u8BBE\u65BD\u201C\u4E09\u540C\u65F6\u201D\u76D1\u7763\u7BA1\u7406\u529E\u6CD5\u300B\u7B2C\u56DB\u6761\u89C4\u5B9A\uFF1A\"\u751F\u4EA7\u7ECF\u8425\u5355\u4F4D\u662F\u5EFA\u8BBE\u9879\u76EE\u5B89\u5168\u8BBE\u65BD\u5EFA\u8BBE\u7684\u8D23\u4EFB\u4E3B\u4F53\u3002\u5EFA\u8BBE\u9879\u76EE\u5B89\u5168\u8BBE\u65BD\u5FC5\u987B\u4E0E\u4E3B\u4F53\u5DE5\u7A0B\u540C\u65F6\u8BBE\u8BA1\u3001\u540C\u65F6\u65BD\u5DE5\u3001\u540C\u65F6\u6295\u5165\u751F\u4EA7\u548C\u4F7F\u7528\uFF08\u4EE5\u4E0B\u7B80\u79F0\"\u4E09\u540C\u65F6\"\uFF09\u3002\u5B89\u5168\u8BBE\u65BD\u6295\u8D44\u5E94\u5F53\u7EB3\u5165\u5EFA\u8BBE\u9879\u76EE\u6982\u7B97\u3002\"[[1]](url?doc_id=1952992489396920322&chunk_id=4)\n\n\u5173\u4E8E\u5371\u9669\u5316\u5B66\u54C1\u5EFA\u8BBE\u9879\u76EE\u7684\"\u4E09\u540C\u65F6\"\uFF0C\u5177\u4F53\u8BF4\u660E\u5982\u4E0B\uFF1A\n\n1. **\u5B9A\u4E49\u5185\u6DB5**\n   - \"\u540C\u65F6\u8BBE\u8BA1\"\uFF1A\u8981\u6C42\u5728\u5EFA\u8BBE\u9879\u76EE\u521D\u6B65\u8BBE\u8BA1\u4E2D\u7F16\u5236\u5B89\u5168\u8BBE\u65BD\u8BBE\u8BA1\u4E13\u7BC7\n   - \"\u540C\u65F6\u65BD\u5DE5\"\uFF1A\u5B89\u5168\u8BBE\u65BD\u5FC5\u987B\u4E0E\u4E3B\u4F53\u5DE5\u7A0B\u540C\u6B65\u65BD\u5DE5\u5EFA\u8BBE\n   - \"\u540C\u65F6\u6295\u5165\u4F7F\u7528\"\uFF1A\u5B89\u5168\u8BBE\u65BD\u5FC5\u987B\u4E0E\u4E3B\u4F53\u5DE5\u7A0B\u540C\u65F6\u9A8C\u6536\u6295\u4EA7\n\n2. **\u9002\u7528\u8303\u56F4**\n   \u9002\u7528\u4E8E\u6240\u6709\u5371\u9669\u5316\u5B66\u54C1\u65B0\u5EFA\u3001\u6539\u5EFA\u3001\u6269\u5EFA\u9879\u76EE\uFF08\u542B\u533B\u836F\u3001\u5316\u5DE5\u7C7B\u9879\u76EE\uFF09\n\n3. **\u6267\u6CD5\u8981\u70B9**\n   - \u5B89\u76D1\u90E8\u95E8\u91CD\u70B9\u5BA1\u67E5\u5B89\u5168\u8BBE\u65BD\u8BBE\u8BA1\u4E13\u7BC7\u7684\u7F16\u5236\u8D28\u91CF\n   - \u65BD\u5DE5\u9636\u6BB5\u9700\u73B0\u573A\u6838\u5B9E\u65BD\u5DE5\u662F\u5426\u7B26\u5408\u6279\u51C6\u7684\u8BBE\u8BA1\u65B9\u6848\n   - \u7AE3\u5DE5\u9A8C\u6536\u65F6\u5FC5\u987B\u7EC4\u7EC7\u5B89\u5168\u8BBE\u65BD\u4E13\u9879\u9A8C\u6536\n\n4. **\u8FDD\u53CD\u540E\u679C**\n   \u672A\u843D\u5B9E\"\u4E09\u540C\u65F6\"\u8981\u6C42\u7684\u9879\u76EE\u4E0D\u5F97\u901A\u8FC7\u5B89\u5168\u5BA1\u67E5\uFF0C\u64C5\u81EA\u6295\u4EA7\u7684\u5C06\u6309\u300A\u5B89\u5168\u751F\u4EA7\u6CD5\u300B\u7B2C\u4E5D\u5341\u516B\u6761\u5904\u7F5A\n\n\u7279\u522B\u6CE8\u610F\uFF1A\u5371\u9669\u5316\u5B66\u54C1\u5EFA\u8BBE\u9879\u76EE\u8FD8\u9700\u6267\u884C\u300A\u5371\u9669\u5316\u5B66\u54C1\u5EFA\u8BBE\u9879\u76EE\u5B89\u5168\u76D1\u7763\u7BA1\u7406\u529E\u6CD5\u300B\u4E2D\u5173\u4E8E\u5B89\u5168\u6761\u4EF6\u5BA1\u67E5\u3001\u5B89\u5168\u8BBE\u65BD\u8BBE\u8BA1\u5BA1\u67E5\u7B49\u7279\u6B8A\u89C4\u5B9A\u3002";
